import React, { Component } from 'react'
import Head from './Head'

class SortBar extends Component {
  constructor(props) {
    super(props);
    this.handleClick = this.sortMostRecent.bind(this);
  }
  handleClick() {
    console.log('Click happened');
  }
  render () {
    return ( 
      <div className="sortbar">
        <div className="sortbar__title">Sort by:</div>
        <div className="sortbar__buttons">
          <div onClick={this.handleClick} className="sortbar__buttons__button sortbar__buttons__button--isactive">Most recent</div>
          <div className="sortbar__buttons__button">Lowest price</div>
          <div className="sortbar__buttons__button">Highest price</div>
        </div>
      </div>
    )
  }
}

export default SortBar
